import { Button } from "../Button/Button";
import { ModalWindowWraper } from "../modalWindowWraper/modalWindowWraper";

export const PauseWindow = () => {
  return (
    <ModalWindowWraper>
      <Button>Continue</Button>
      <Button>Reset</Button>
    </ModalWindowWraper>
  );
};
